☁️GIVEAWAY!☁️

Our sweet friend Karrie Locher, mama and postpartum RN who shares some of the best advice for families and babes, recently welcomed her fourth (FOURTH!) little one. To help her celebrate, @tubbytodd and @pregnantchicken are hosting Karrie's New Baby Essentials Giveaway, and we've joined in the celebration to gift over $3,500 in prizes to one lucky mama! Follow the steps below to enter to win all of the goodies:

1/ Like this post!

2/ Make sure you're following all brands here on IG:

@tubbytodd
@pregnantchicken
@karrie_locher
@adenandanais
@halosleep
@itsbodily
@haakaausa
@sollybaby
@bumbleride

3/ Tag (real!) friends below and give them a chance to win! Friends don’t let friends miss out on giveaways this good.

4/ Head to the link in @tubbytodd's bio to complete your entry.

*Giveaway ends at 11:59 p.m. PST on 9/28. Winner will be announced by 9/30 on @tubbytodd's original giveaway post. Open to U.S. residents only. Void where prohibited by law, must be 18 years or older to enter. (Please note: winners will only be notified by the Tubby Todd Bath Co. account. If you receive messages from an account claiming to be a "giveaway winner selection" account please disregard and report as spam!) Good luck!
